#! /usr/bin/env python
data=''''''

import gzip
import base64
import random

gzipped_bytes = base64.b64decode(data)
src_bytes = gzip.decompress(gzipped_bytes)
text = src_bytes.decode("utf-8")

length = len(text)
si = random.randint(0, length)
di = si

while True:
	while si < length-1 and (text[si] != '\n' or text[si+1] != '\n'):
		si += 1
		if si >= length-1:
			si = 0

	si = si + 2 if si < length-1 else 0
	di = si

	while di < length-1 and (text[di] != '\n' or text[di+1] != '\n'):
		di += 1
		if di >= length-1:
			di = 0

	if si <= di:
		break

def color_generator():
	colors = ['\033[92m', '\033[94m']
	index = 0
	while True:
		yield colors[index]
		index = (index+1) % len(colors)

color = color_generator();

def println(line):
	print(next(color) + line + '\033[0m')

section = text[si:di]
start_pos = 0
for i in range(len(section)):
	if section[i] == 'ã€‘':
		println(section[start_pos:i+1])
		start_pos = i+1

while start_pos < len(section) and section[start_pos] == ' ':
	start_pos += 1

if start_pos < len(section):
	println(section[start_pos:])
